import React from 'react';

import { GiHamburgerMenu } from 'react-icons/gi';
import { MdOutlineRestaurantMenu, MdoutlineRestaurantMenu } from 'react-icons/md';

import images from '../../constants/images';


import './Navbar.css';

const Navbar = () => {

  const [toggleMenu, settoggleMenu] = React.useState(false);
return(

    <nav className='app__navbar'>
      <div className='app__navbar-logo'>
        <img src={images.gericht} alt="app logo"/>
    </div>
      <ul className='app__navbar-links'>
        <li className='p__opensans'><a href='#home'>Home</a></li>
        <li className='p__opensans'><a href='#about'>about</a></li>
        <li className='p__opensans'><a href='#Menu'>Menu</a></li>
        <li className='p__opensans'><a href='#order'>order</a></li>
        <li className='p__opensans'><a href='#contact'>contact</a></li>
      </ul>
      <div className='app__navbar-bt'>
        <a href='#bt' className='p__opensans'>Book Table</a>
        <div/>
      <a href='/' className='p__opensans'>Login</a>
      </div>
      <div className='app__navbar-smallscreen'>
        <GiHamburgerMenu color='#fff' fontSize={27} onClick={() => settoggleMenu(true)}/>

    {toggleMenu && (
          <div className='app__navbar-smallscreen_overlsay flex__centre slide_bottom'>
            <MdOutlineRestaurantMenu fontSize={27} className='overlay_close' onClick={() =>settoggleMenu(false)}/>

          <ul className='app__navbar-smallscreen-links'>
            <li className='p__opensans'><a href='#home'>Home</a></li>
            <li className='p__opensans'><a href='#about'>about</a></li>
            <li className='p__opensans'><a href='#Menu'>Menu</a></li>
            <li className='p__opensans'><a href='#order'>order</a></li>
            <li className='p__opensans'><a href='#contact'>contact</a></li>
          </ul>
          </div>        
      )}
        </div>
    </nav>
  );
}
export default Navbar;
